import * as React from 'react';

import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import Stack from '@mui/material/Stack';
import Select from '@mui/material/Select';
function Form (){

    const [age, setAge] = React.useState('');

    const handleChange = (event) => {
      setAge(event.target.value);
    };

    return(
        <>
            <Box>   
                <Grid container spacing={2}>
                    <Grid item xs={8} style={{background:'red'}}>
                        <h1 className='text'>Pasarela de pago</h1>
                    </Grid>
                    <Grid item xs={4} style={{background:'blue'}}>

                    </Grid>
                    <Grid item xs={5} style={{background:'purple'}}>
                        <div className='box'>
                        <Stack sx={{ width: '100%' }} spacing={2}>
                            <TextField type='email' label="Email" focused  placeholder="example@example.com"/>
                            <Select
                            placeholder="example@example.com"
                            focused
                            id="demo-simple-select"
                            value={age}
                            onChange={handleChange}
                            >
                            <MenuItem value={10}>Cedula de ciudadania</MenuItem>
                            <MenuItem value={20}>Cedula de extranjeria</MenuItem>
                            <MenuItem value={30}>Pasaporte</MenuItem>
                            </Select>
                            <TextField  label="Documento Identidad" variant="outlined" type='number' /> 
                        </Stack>
                        </div>
                    </Grid>
                    <Grid item xs={8} style={{background:'yellow'}}>

                    </Grid>
                </Grid>
            </Box>  
        </>
    )
}
export default Form;
